import React from 'react';

const MainFeed = () => {

    return (
        <div className="main-feed" >
            <div className="question-post">
                <div className="question-user-photo">
                    <img src="https://randomuser.me/api/portraits/men/93.jpg" alt="User's profile picture" />
                </div>

            </div>
        </div>
    )


}

export default MainFeed;
